/**
 * TextField component
 * @param variant
 * @param type
 * @param children
 * @param icon
 * @param onClick
 * @param fullWidth
 * @returns {JSX.Element}
 */
export function TextField({value, onChange, icon, placeholder, type, ...rest}) {
    return <div className="rounded-md bg-gray-100 flex ">
        {icon}
        <input type={type} value={value} onChange={onChange} placeholder={placeholder} {...rest}
                       className="bg-gray-100 p-2 text-gray-600"/>
    </div>
}
